import React from "react";
import Game from "./Game/Game";
import s from "./Shop.module.css"

const Shop = (props) => {
  let state = props.shopPage;

  let gamesElements = [
    state.games.map((g) => 
      <Game
        name={g.gameName}
        photo={g.gamePhoto}
        developer={g.developer}
        price={g.gamePrice}
      />
    ),
  ];

  return (
    <div className={s.shopContent}>
      <div>Search</div>
      <div>{gamesElements}</div>
    </div>
  );
};

export default Shop;
